import {
  FiBox,
  FiFileText,
  FiUsers,
  FiClock,
  FiPlus,
  FiArrowRight,
} from "react-icons/fi";

const Dashboard = () => {
  return (
    <div className="min-h-screen bg-gray-100 p-6 space-y-8">

      {/* ===== HEADER ===== */}
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-3xl font-bold text-gray-900">
            Dashboard
          </h1>
          <p className="text-gray-500 mt-1">
            Overview of Amplinovaâ€™s products & brouchers
          </p>
        </div>

        <button className="flex items-center gap-2 bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700">
          <FiPlus /> Create Broucher
        </button>
      </div>

      {/* ===== KPI CARDS ===== */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
        <KpiCard title="Total Products" value="6" icon={<FiBox />} />
        <KpiCard title="Total Brouchers" value="14" icon={<FiFileText />} />
        <KpiCard title="Active Clients" value="9" icon={<FiUsers />} />
        <KpiCard title="Pending Requests" value="3" icon={<FiClock />} />
      </div>

      {/* ===== MAIN CONTENT ===== */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">

        {/* PRODUCTS OVERVIEW */}
        <div className="lg:col-span-2 bg-white rounded-2xl shadow p-6">
          <h2 className="text-xl font-semibold text-gray-900 mb-4">
            Products Overview
          </h2>

          <div className="space-y-4">
            <ProductRow name="Restaurant Management" status="Active" />
            <ProductRow name="Hospitality Solutions" status="Draft" />
            <ProductRow name="Tours & Travels" status="Active" />
          </div>
        </div>

       
      </div>

      
    </div>
  );
};

export default Dashboard;

/* ===== COMPONENTS ===== */

const KpiCard = ({ title, value, icon }) => (
  <div className="bg-white rounded-2xl shadow p-6 flex justify-between items-center">
    <div>
      <p className="text-gray-500 text-sm">{title}</p>
      <h3 className="text-3xl font-bold text-gray-900 mt-1">
        {value}
      </h3>
    </div>
    <div className="text-blue-600 text-2xl">
      {icon}
    </div>
  </div>
);

const ProductRow = ({ name, status }) => (
  <div className="flex justify-between items-center border rounded-lg p-4">
    <div>
      <h4 className="font-medium text-gray-900">{name}</h4>
      <p className="text-sm text-gray-500">
        Status:{" "}
        <span
          className={`font-medium ${
            status === "Active" ? "text-green-600" : "text-orange-500"
          }`}
        >
          {status}
        </span>
      </p>
    </div>
    <button className="flex items-center gap-1 text-blue-600 hover:underline">
      View <FiArrowRight />
    </button>
  </div>
);

const ActionButton = ({ label }) => (
  <button className="border rounded-lg px-4 py-2 hover:bg-gray-100">
    {label}
  </button>
);
